import React, { Component } from 'react';
import './App.css';

export class App extends Component {
   constructor(props) {
      super(props)
      this.state = {
         board: Array(9).fill(null)
      }
   }

   render() {
      const Box = this.state.board.map(boxjumlah => <div className='box' on>{boxjumlah}</div>)
      return (
         <div className='container'>
            <h1> Tic-tac-toe</h1>
            <div className='board'> {Box}

            </div>

         </div>
      )
   }
}

export default App
